import React from 'react';

const Profile = () => {
  return (
    <div className="profile-container">
      <h2>Student Details</h2>
      <p><strong>Name:</strong> Ashwin Paturi</p>
      <p><strong>Email:</strong> paturiashwinshastry@cityuniversity.edu</p>
      <p><strong>Course:</strong> Master's in Computer Science</p>
      <p><strong>University:</strong> City University of Seattle</p>
    </div>

  );
};

export default Profile;
